@metas = []
@count = 0
@level = 1

def get_metadata_recursive(inp)
  node_count = inp.first
  meta_count = inp[1]
  if node_count == 0
    @metas.concat(inp[2...(2+meta_count)])
    return 2 + meta_count
  end
  offset = 2
  node_count.times do |i|
    length = get_metadata_recursive(inp[offset..-1])
    offset += length
  end
  @metas.concat(inp[offset...(offset+meta_count)])
  return offset
end

def get_metadata(inp)
  mode = 0
  metas = []
  node_counts = []
  meta_counts = []
  inp.each do |x|
    # puts [mode, x, "node_counts: #{node_counts.inspect}", "meta_counts: #{meta_counts.inspect}"].inspect
    case mode
    when 0
      if node_counts.last
        n_count = node_counts.pop
        node_counts << (n_count - 1)
      end
      node_counts << x
      mode = 1
    when 1
      meta_counts << x
      if node_counts.last > 0
        mode = 0
      else
        mode = 2
      end
    when 2
      metas << x
      if meta_counts.last == 1
        meta_counts.pop
        node_counts.pop
        if node_counts.last && node_counts.last > 0
          mode = 0
        else
          mode = 2
        end
      else
        m_count = meta_counts.pop
        meta_counts << (m_count - 1)
      end
    end
  end
  metas
end

# part 2
class Node
  attr_accessor :node_count, :meta_count, :meta_list, :children, :leaf

  def initialize(node_count)
    @node_count = node_count
    @leaf = node_count == 0
    @children = []
    @meta_list = []
  end

  def sub_meta_count
    @meta_count -= 1
  end

  def sub_node_count
    @node_count -= 1
  end
end

def get_metadata_nodes(inp)
  mode = 0
  node_stack = []
  finished_nodes = []
  inp.each do |x|
    # puts [mode, x, "node_counts: #{node_counts.inspect}", "meta_counts: #{meta_counts.inspect}"].inspect
    case mode
    when 0
      if node_stack.last
        parent = node_stack.last
        parent.sub_node_count
      end
      new_node = Node.new(x)
      node_stack << new_node
      parent.children << new_node if parent
      mode = 1
    when 1
      node_stack.last.meta_count = x
      if node_stack.last.node_count > 0
        mode = 0
      else
        mode = 2
      end
    when 2
      node_stack.last.meta_list << x
      if node_stack.last.meta_count == 1
        finished_nodes << node_stack.pop
        if node_stack.last && node_stack.last.node_count > 0
          mode = 0
        else
          mode = 2
        end
      else
        node_stack.last.sub_meta_count
      end
    end
  end
  finished_nodes
end

def get_value(node)
  if node.leaf
    node.meta_list.sum
  else
    node.meta_list.map do |i|
      child = node.children[i-1]
      child ? get_value(child) : 0
    end.sum
  end
end

