"463 players; last marble is worth 71787 points"

players = Array.new(463) { 0 };

circle = [0]
i = 0

1.upto(71787) do |marble|
  if marble % 23 == 0
    i = (i - 7)%circle.length
    removed = circle.delete_at(i)
    players[marble%players.length] += (marble + removed)
  else
    i = (i + 2)%circle.length
    circle.insert(i, marble)
  end
end
players.max


