players = Array.new(463) { 0 };

first_node = { prev: nil, next: nil, marble: 0 }
first_node[:prev] = first_node
first_node[:next] = first_node
cur_node = first_node

1.upto(7178700) do |marble|
  if marble % 23 == 0
    cur_node = cur_node[:prev][:prev][:prev][:prev][:prev][:prev]
    removed = cur_node[:marble]
    cur_node[:prev][:next] = cur_node[:next]
    cur_node[:next][:prev] = cur_node[:prev]
    players[marble%players.length] += (marble + removed)
  else
    cur_node = cur_node[:next][:next]
    after = cur_node[:next]
    new_node = { prev: cur_node, next: after, marble: marble }
    cur_node[:next] = new_node
    after[:prev] = new_node
  end
end

players.max



