# Day 11
# part 1
arr = Array.new(300) { Array.new(300) { 0 }};
serial = 7165

arr.each_with_index do |arrs, x|
  arrs.each_with_index do |i, y|
    rack_id = x+1 + 10
    level = rack_id * (y+1)
    level += serial
    level *= rack_id
    level = level.to_s.chars[-3].to_i
    level -= 5
    arr[x][y] = level
  end
end;

max = 0

coords = []

0.upto(297) do |x|
  0.upto(297) do |y|
    total = arr[x][y] + arr[x+1][y] + arr[x+2][y] + arr[x][y+1] + arr[x+1][y+1] + arr[x+2][y+1] + arr[x][y+2] + arr[x+1][y+2] + arr[x+2][y+2]
    if total > max
      max = total
      coords = [x,y]
    end
  end
end

# part 2

max = 0
coords = []
3.upto(300) do |size|
  puts size
  0.upto(297) do |x|
    0.upto(297) do |y|
      next if (x + size) > 300 || (y + size) > 300
      total = arr[x...x+size].map do |sub|
        sub[y...y+size].sum
      end.sum
      if total > max
        max = total
        coords = [x,y,size]
      end
    end
  end
end

