initial = (buffer + '##.#.####..#####..#.....##....#.#######..#.#...........#......##...##.#...####..##.#..##.....#..####............................').chars;
matches = %w[#..#. #.#.# #.#.. .#... .#.## ..#.. ..### ##.#. ##.## .##.# ...## ##... .#..# ####. .##..]

current = initial;
after = ['.', '.']

20.times do
  current.each_cons(5).with_index do |group, i|
    if matches.include?(group.join)
      after[i+2] = '#'
    else
      after[i+2] = '.'
    end
  end
  puts after.join
  current = after
end

total = 0
current.each_with_index do |x, i|
  total += (i-buffer.length) if x == '#'
end;

# part 2
current = initial;
after = ['.', '.']

130.times do |j|
  current.each_cons(5).with_index do |group, i|
    if matches.include?(group.join)
      after[i+2] = '#'
    else
      after[i+2] = '.'
    end
  end
  puts j.to_s + '*******************************' if current == after.rotate
  current = after.rotate

  total = 0
  current.each_with_index do |x, i|
    total += (i + j - buffer.length - 1) if x == '#'
  end;
end

current.each_with_index do |x, i|
  total += (i + 50000000000 - buffer.length) if x == '#'
end;



