first_node[:prev] = last_node
first_node[:next] = last_node

cur_first = first_node
cur_second = last_node
length = 2
loop do
  new_recipe = cur_first[:val] + cur_second[:val]
  nodes = new_recipe.to_s.chars.map { |char| { prev: nil, next: nil, val: char.to_i } }
  if nodes.length == 1
    length += 1
    node = nodes.first
    node[:prev] = last_node
    node[:next] = first_node
    last_node[:next] = node
    first_node[:prev] = node
    last_node = node
  elsif nodes.length == 2
    length += 2
    node1 = nodes.first
    node2 = nodes.last
    node1[:prev] = last_node
    node1[:next] = node2
    node2[:prev] = node1
    node2[:next] = first_node
