  when 'bori'
    registers[c] = registers[a] | b
  when 'setr'
    registers[c] = registers[a]
  when 'seti'
    registers[c] = a
  when 'gtir'
    registers[c] = (a > registers[b] ? 1 : 0)
  when 'gtri'
    registers[c] = (registers[a] > b ? 1 : 0)
  when 'gtrr'
    registers[c] = (registers[a] > registers[b] ? 1 : 0)
  when 'eqir'
    registers[c] = (a == registers[b] ? 1 : 0)
  when 'eqri'
    registers[c] = (registers[a] == b ? 1 : 0)
  when 'eqrr'
    registers[c] = (registers[a] == registers[b] ? 1 : 0)
  end
  ip = registers[ip_reg]
  ip += 1
end
